em></b>. We recommend disabling these and setting up new rates within shipping zones as soon as possible.'=>'วิธีการจัดส่งแบบเดิม (อัตราคงที่, อัตราคงที่ระหว่างประเทศ, รับสินค้าและการส่งสินค้าในท้องถิ่น และการจัดส่งฟรี) จะถูกเลิกใช้ แต่จะยังคงทำงานตามปกติในตอนนี้ <b><em>วิธีการเหล่านี้จะถูกนำออกไปในเวอร์ชันอนาคตของ WooCommerce</em></b> เราขอแนะนำให้ปิดการใช้วิธีการเหล่านี้ แล้วกำหนดอัตราใหม่ภายในโซนการจัดส่งให้เร็วที่สุดเท่าที่จะเป็นไปได้','WooCommerce database update'=>'การอัปเดตฐานข้อมูล WooCoommerce','Username isn\'t editable.'=>'ชื่อผู้ใช้ไม่สามารถแก้ไขได้','Unique identifier for the object.'=>'ตัวบ่งชี้เฉพาะสำหรับ object','For example:'=>'ตัวอย่าง','US domestic zone = All US states = Flat rate shipping'=>'เขตจัดส่งในอเมริกา = ทุกรัฐในอเมริกา = การขนส่งแบบเหมาจ่าย','Europe zone = Any country in Europe = Flat rate shipping'=>'ยุโรปโซน = ประเทศใดๆ ในทวีปยุโรป = จัดส่งสินค้าอัตราคงที่','Add as many zones as you need &ndash; customers will only see the methods available for their address.'=>'ใส่เขตจัดส่งเพิ่มเท่าที่ท่านต้องการ &ndash; ลูกค้าจะเห็นเพียงแค่วิธีการจัดส่งเหมาะสมกับที่อยู่ของลูกค้า','Limit to specific ZIP/postcodes'=>'จำกัดเฉพาะบางเลขไปรษณีย์/รหัสไปรษณีย์','Displays whether or not WP Cron Jobs are enabled.'=>'แสดงไม่ว่า WP Cron เปิดใช้งานหรือไม่','WordPress requirements'=>'ความต้องการของ Wordpress','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'เซิร์ฟเวอร์ของคุณไม่รองรับ %s ฟังชั่น - ซึ่งจำเป็นต้องใช้กับ GeoIP database จาก MaxMind.','MaxMind GeoIP database.'=>'ฐานข้อมูล MaxMind GeoIP','Page ID is set, but the page does not exist'=>'Page ID ถูกตั้งขึ้น แต่หน้านั้นไม่มีอยู่','Archive template'=>'เทมเพลตคลังเก็บ','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'ธีมของคุณประกอบด้วยไฟล์ woocommerce.php ซึ่งคุณจะไม่สามา