oLite จะถูกดาวน์โหลดเป็นระยะๆ ไปยังไดเร็กทอรี wp-content ของคุณหากใช้ตำแหน่งทางภูมิศาสตร์','Product count'=>'จำนวนสินค้า','Sell to all countries, except for&hellip;'=>'ขายทุกประเทศ ยกเว้น&hellip;','Payment methods'=>'วิธีการชำระเงิน','Set default payment method'=>'ตั้งค่าวิธีการชำระเงินเริ่มต้น','Shipping location(s)'=>'สถานที่จัดส่ง','Ship to specific countries'=>'ส่งเฉพาะประเทศที่กำหนด','Sell to specific countries'=>'ขายเฉพาะประเทศที่กำหนด','Add shipping class'=>'เพิ่มประเภทการจัดส่ง','No shipping classes have been created.'=>'ยังไม่มีการสร้างประเภทการจัดส่ง','Edit item'=>'แก้ไขสินค้า','Delete item'=>'ลบสินค้า','Add item(s)'=>'เพิ่มสินค้า','Note: the refund reason will be visible by the customer.'=>'หมายเหตุ: ลูกค้าสามารถมองเห็นเหตุผลการขอคืนเงิน','This order is no longer editable.'=>'การสั่งซื้อนี้ไม่สามารถเปลี่ยนแปลงได้อีก','Customer download link'=>'ลิงก์ดาวน์โหลดสำหรับลูกค้า','Tax status'=>'สถานะภาษี','Stock quantity'=>'ปริมาณสินค้าในคลัง','Help &amp; Support'=>'การช่วยเหลือและสนับสนุน','Community forum'=>'ฟอรั่มชุมชน',' Stripe'=>'Stripe','Accept payments via PayPal using account balance or credit card.'=>'รับชำระด้วย PayPal โดยใช้เงินในบัญชี หรือบัตรเครดิต','Bank transfer (BACS) payments'=>'ชำระเงินผ่านการโอนเข้าบัญชีธนาคาร','Sorry, you cannot list resources.'=>'ขออภัย, คุณไม่สามารถแสดงรายชื่อแหล่งข้อมูลได้','Save to account'=>'บันทึกไปยังบัญชี','Sorry, you are not allowed to create resources.'=>'ขออภัย คุณไม่ได้รับอนุญาตให้สร้าง resources','Sorry, you cannot view this resource.'=>'ขออภัยคุณไม่ได้รับสิทธิ์ในการดูข้อมูลส่วนนี้','Sorry, you are not allowed to edit this resource.'=>'ขออภัยคุณไม่ได้รับสิทธิ์ในการแก้ไขข้อมูลส่วนนี้','Sorry, you are not allowed to delete %s.'=>'ขออภัยคุณไม่ได้รับสิทธิ์ในการลบ %s.','The %s does not support trashing.'=>'%s ไม่รองรับการลบ','The %s has already been deleted.'=>' %s ได้ถูกลบแล้ว','Sorry, you are not allowed to delete this resource.'=>'ขออภัยคุณไม่ได้รับสิทธิ์ในการลบข้อมูลส่วนนี้','Invalid ID.'=>'ไอดีไม่ถูกต้อง','Cannot c