ณีย์ที่อนุญาต','What ZIP/post codes are available for local delivery?'=>'มีรหัสไปรษณีย์อะไรบ้างที่ครอบคลุมการจัดส่งในพื้นที่','What ZIP/post codes are available for local pickup?'=>'มีรหัสไปรษณีย์อะไรบ้างที่อนุญาตให้มารับสินค้าเองได้','Order #%1$s has been marked as refunded - PayPal reason code: %2$s'=>'คำสั่งซื้อ #%s ถูกตั้งให้เป็นสถานะคืนเงินแล้ว - รหัส PayPal reason code: %s','Debug log'=>'Debug Log','IPN payment completed'=>'การชำระเงินผ่าน Paypal IPN สำเร็จแล้ว','Enable logging'=>'เปิดใช้งาน logging','API credentials'=>'API Credentials','Email heading (paid)'=>'หัวข้ออีเมล (ชำระแล้ว)','Refunded order'=>'การสั่งซื้อที่ได้รับการคืนเงินแล้ว','Customer "reset password" emails are sent when customers reset their passwords.'=>'เมื่อลูกค้าต้องการรีเซ็ตรหัสผ่าน อีเมลสำหรับ "รีเซ็ตรหัสผ่าน" จะถูกส่งออกไป','This controls the description which the user sees during checkout.'=>'ส่วนควบคุมคำอธิบายแก่ผู้ใช้ระหว่างขั้นตอนการชำระเงิน','Customer "new account" emails are sent to the customer when a customer signs up via checkout or account pages.'=>'อีเมลสำหรับ "บัญชีใหม่" ของลูกค้าจะถูกส่งไปยังลูกค้าเมื่อลูกค้าสมัครสมาชิกผ่านหน้าชำระเงินหรือหน้าบัญชี','PDT payment completed'=>'การส่งข้อมูลการจ่ายเงินไปยัง PayPal เสร็จสมบูรณ์แล้ว','Validation error: PayPal amounts do not match (amt %s).'=>'มีข้อผิดพลาดในการตรวจสอบ : จำนวนเงิน PayPal ไม่ตรงกัน (amt %s)','Payment action'=>'การชำระเงิน','New order emails are sent to chosen recipient(s) when a new order is received.'=>'เมื่อมีคำสั่งซื้อใหม่ อีเมลคำสั่งซื้อจะถูกส่งไปยังผู้รับที่ได้เลือกไว้','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'ถ้า COD สามารถใช้ได้เพียงวิธีการนี้เท่านั้น, ให้ตั้งค่าที่นี่ ถ้าต้องการใช้สำหรับทุกวิธีการให้ปล่อยว่างไว้','Order complete emails are sent to customers when their orders are marked completed and usually indicate that their orders have been shipped.'=>'อีเมลทำการรายสั่งซื้อสำเร็จจะส่งไปหาลูกค้าเมื่อรายการสั่งซื้อของพวกเขาถูกบันทึกว่าทำเสร็จแล้ว และมักจะระบุว่าสินค้าที่พวกเขาซื้อได้ถูกจัดส่งแล้ว','Order refunded emails are sent to customers when their orders are refunded.'=>'อีเมลขอคืนเงินจะส่งไปหาลูกค้าเมื่อระบบบันทึกว่ารายการสั่งซื้อของพวกเขาได้รับเงินคืนแล้ว','Please enter your PayPal email address; this is needed in order to take payment.'=>'กรุณาใส่อีเมลที่ใช้กับ Paypal ของคุณ ซึ่งจะถูกใช้รับชำระเงิน','Full refund email heading'=>'หัวข้ออีเมลในการคืนเงินเต็มจำนวน','Partial refund email heading'=>'หัวข้ออีเมลในการคืนเงินบางส่วน','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'ถ้าอีเมล PayPal หลักของคุณแตกต่างจาก อีเมล PayPal ด้านบน  ให้ใส่อีเมลหลักสำหรับบัญชี PayPal ของคุณที่นี่  เพื่อใช้ในการตรวจสอบการร้องขอ IPN','Percentage of cart total'=>'จำนวนเปอร์เซนต์ทั้งหมดในตะกร้า','Enable check payments'=>'เปิดใช้การชำระเงินด้วยเช็ค','Please send a check to Store Name, Store Street, Store Town, Store State / County, Store Postcode.'=>'กรุณาส่งเช็คของคุณมาที่ ชื่อร้าน, ที่อยู่ร้านเช่น ถนน ตำบล อำเภอ/เขต จังหวัด รหัสไปรษณีย์','This is an order notification sent to customers containing order details after payment.'=>'การแจ้งเตือนรายการสั่งซื้อนี้ถูกส่งไปยังลูกค้า ประกอบไปด้วยรายละเอียดการสั่งซื้อหลังจากชำระเงิน','Make your payment directly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.'=>'ชำระเงินโดยการโอนเงินเข้าบัญชีธนาคาร โดยหลังการชำระเงิน กรุณาส่งหลักฐานยืนยันพร้อมเลขที่ใบสั่งซื้อ เพื่อดำเนินการส่งของต่อไป','What is PayPal?'=>' PayPal คืออะไร?','Direct bank transfer'=>'โอนเงินเข้าบัญชีธนาคาร','Processing order'=>'กำลังเตรียมสินค้าเพื่อจัดส่ง','PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>'PayPal จะตรวจยืนยันที่อยู่ ดังนั้น การตั้งค่านี้สามารถทำให้เกิดข้อผิดพลาดได้ (เราขอแนะนำให้ปิดการใช้งานไว้)','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'จะสนับสนุนตัวรองรับต่อไปนี้: <code>[qty]</code> = จำนวนสินค้า, <code>[cost]</code> = ราคาสินค้า, <code>[fee percent=”10” min_fee=”20”]</code> = ค่าธรรมเนียมคิดเป็นเปอร์เซ็นต์','One per line: Option name | Additional cost [+- Percents] | Per cost type (order, class, or item) Example: <code>Priority mail | 6.95 [+ 0.2%] | order</code>.'=>'หนึ่งรายการต่อบรรทัด: ชื่อตัวเลือก | ค่าใช้จ่ายเพิ่มเติม [+- เปอร์เซ็นต์] | ต่อประเภทค่าใช้จ่าย (การสั่งซื้อ คลาส หรือรายการ) ตัวอย่าง: <code>Priority Mail | 6.95 [+ 0.2%] | การสั่งซื้อ</code>','Separate codes with a comma. Accepts wildcards, e.g. <code>P*</code> will match a postcode of PE30. Also accepts a pattern, e.g. <code>NG1___</code> would match NG1 1AA but not NG10 1AA'=>'แบ่งรหัสด้วยเครื่องหมายจุลภาค ยอมรับสัญลักษณ์แทน เช่น <code>P*</code> จะตรงกับรหัสไปรษณีย์ PE30 และยังยอมรับรูปแบบ เช่น <code>NG1___</code> จะตรงกับ NG1 1AA แต่ไม่ตรงกับ NG10 1AA','These rates are extra shipping options with additional costs (based on the flat rate).'=>'อัตราเหล่านี้เป็นตัวเลือกการจัดส่งเพิ่มเติมพร้อมด้วยค่าใช้จ่ายเพิ่มเติม (คิดตามอัตราเดียว)','Remove selected account(s)'=>'ลบบัญชีที่เลือก','Sort code'=>'สาขา','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'เปิดแบบตัวเลือก “กาโอนย้ายข้อมูลการชำระเงิน” (โปรไฟล์ > โปรไฟล์และการตั้งค่า > เครื่องมือการขายของฉัน > การกำหนดค่าเว็บไซต์) จากนั้นคัดลอกโทเคนอัตลักษณ์ของคุณที่นี่ วิธีนี้จะทำให้มีการตรวจยืนยันการชำระเงินโดยไม่ต้องมี PayPal IPN','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'โปรดใส่คำนำหน้าสำหรับหมายเลขใบแ